import React, { useRef, useState } from "react";

import { MapContainer,TileLayer,Marker, Popup } from 'react-leaflet';


import loc from '../assets/home/icons/location.svg';
import phone from '../assets/home/icons/phone.svg';
import mail from '../assets/home/icons/mail.svg';

export default function ContactUs() {
  const mapRef = useRef(null);



  return (
<section> 
  <section className="get_in_touch">
    <section className="contact_touch" >
      <h3>Get In Touch!</h3>
        <h5> Fill up the form and our Team will get back to you within 24 hours.</h5>
          <button> <img src={loc} alt="Piazza Napoleone"/> <p>Piazza Napoleone, Lucca, Tuscany</p></button>
          <button> <img src={phone} alt="call to us"/> <p>	+39 346 368 5708</p></button>
          <button> <img src={mail} alt="send to us"/> <p>	italiainlimo@gmail.com</p></button>
    </section>
            <section className="forForm">
              <label/> Name and Surname
                <input placeholder="Enter your name and surname" {...register("Name and Surname")}/> 
              <label/>Email Address
                <input placeholder="Enter your email address" {...register("Email")}/> 
              <label/> Message
                <input type="textarea" placeholder="Enter your message"/>
                    <button className="btn_submit" type="submit" >
                      <span>Send Message</span> 
                    </button> 
            </section>
                    </section>
                    <div id="map">
      <MapContainer center={[43.002612627161284, 12.38475051382631]} zoom={5} scrollWheelZoom={true} style={{ height: "400px", width: "100%" }}>
      <TileLayer
        url="https://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}{r}.png"
        attribution='&copy; <a href="https://www.carto.com/attributions">CartoDB</a>'
      />
      
      <Marker position={[43.56469, 11.02011]}>
        <Popup>
         Tuscany
        </Popup>
      </Marker>

      <Marker position={[43.84373723290542,10.516281148313121]}>
        <Popup>
         Lucca
        </Popup>
      </Marker>

      <Marker position={[43.32363389973403,11.331457027370416]}>
        <Popup>
        Sienna
        </Popup>
      </Marker>

      <Marker position={[45.43931,10.97976]}>
        <Popup>
          Verona
        </Popup>
      </Marker>

      <Marker position={[43.72034,10.40444]}>
        <Popup>
          Pisa
        </Popup>
      </Marker>

      <Marker position={[43.77656,11.26965]}>
        <Popup>
          Florence
        </Popup>
      </Marker>

    </MapContainer>

      </div>
</section>
  );
}
